$(document).ready(function(){

 	setInterval(function(){ 
 		$("#user-dropdown-nav").toggleClass("text-danger");
 		alert("here");
 	}, 2000);


 	$.ajax({
      url: '/messages/check',
      async: false,
      method: "POST",
      //data: data,
      success: function(results) {
        var res = JSON.parse(results);
        console.log(results);
      }
    });

});
